import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import Login from '../pages/login/Login';
import Home from '../pages/home/Home';
import HomeAdmin from '../pages/home/HomeAdmin';
import HomeProfesor from '../pages/home/HomeProfesor';
import HomeEstudiante from '../pages/home/HomeStudent';


function Routes() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Login}/>
        <Route exact path="/home" component={Home}/>
        <Route exact path="/homeAdmin" component={HomeAdmin}/>
        <Route exact path="/homeProfesor" component={HomeProfesor}/>
        <Route exact path="/homeEstudiante" component={HomeStudent}/>

      </Switch>
    </BrowserRouter>
  );
}

export default Routes;
